import React, { useState } from 'react'

const Task = (props) => {
  return (
    <div className="d-flex">
      <button></button>
      {props.taskTitle}
      <form action="">
        <label htmlFor="done"></label>
        <input
          type="checkbox"
          name="done"
          id="done"
          checked={props.completed}
          onChange={props.toggleComplete}
        />
      </form>
      <button className="btn btn-danger" onClick={props.handleDelete}>
        Delete
      </button>
    </div>
  )
}

export default Task
